class Submission:
    def __init__(self, content):
        self.content = content
        self.is_valid = False
        self.is_published = False

    def validate(self):
        # Simple validation logic for example purposes
        self.is_valid = bool(self.content) and len(self.content) < 1000
        return self.is_valid

    def publish(self):
        if self.is_valid and not self.is_published:
            self.is_published = True
        else:
            raise Exception("Submission must be validated and not already published.")

class UserTesting:
    def __init__(self):
        self.sessions = []

    def schedule_testing(self, session_details):
        self.sessions.append(session_details)

    def report_results(self, results):
        # Logic to report results to agencies
        print("Reporting results:", results)

    def create_summary(self):
        # Logic to create a summary of user testing
        return f"Summary of {len(self.sessions)} testing sessions."

class ActivityLog:
    def __init__(self):
        self.log_entries = []

    def log_activity(self, activity):
        self.log_entries.append(activity)

class ValidationRules:
    def __init__(self):
        self.rules = []

    def update_rules(self, new_rules):
        self.rules = new_rules

    def validate_submission(self, submission):
        # Implementing sample validation against rules
        return all(rule(submission) for rule in self.rules)

class SubmissionManager:
    def __init__(self):
        self.submissions = []
        self.activity_log = ActivityLog()

    def upload_submission(self, content):
        submission = Submission(content)
        self.submissions.append(submission)
        self.activity_log.log_activity(f"Uploaded submission: {content}")
        return submission

    def validate_submission(self, submission):
        is_valid = submission.validate()
        self.activity_log.log_activity(f"Validated submission: {submission.content}, Valid: {is_valid}")
        return is_valid

    def publish_submission(self, submission):
        submission.publish()
        self.activity_log.log_activity(f"Published submission: {submission.content}")

    def prevent_double_publishing(self, submission):
        if not submission.is_published:
            return True
        raise Exception("Submission already published.")

class DataUser:
    def delete_data(self, submission_manager, content):
        for submission in submission_manager.submissions:
            if submission.content == content:
                submission_manager.submissions.remove(submission)
                submission_manager.activity_log.log_activity(f"Deleted submission: {content}")
                return True
        return False

class BrokerUser:
    def create_content_mockup(self, submission):
